ctions"" aria-controls=""tab-panel-bulk-actions"">           批量操作        </a>         </li>              </ul>       </div>              <div class=""contextual-help-sidebar"">        <p><strong>更多信息：</strong></p><p><a href=""https://codex.wordpress.org/Posts_Screen"">管理文章文档</a></p><p><a href=""https://wordpress.org/support/"">支持论坛</a></p>     </div>              <div class=""contextual-help-tabs-wrap"">                 <div id=""tab-panel-overview"" class=""help-tab-content active"">          <p>本页面提供文章相关的所有功能。您可以自定义页面的样式来使工作更顺手。</p>       </div>                 <div id=""tab-panel-screen-content"" class=""help-tab-content"">          <p>您可以通过以下方法来自定义本页面内容的显示方式：</p><ul><li>您可在“显示选项”中依据您的需要隐藏或显示每页显示的文章数量。</li><li>您可以通过点击列表上方的文字链接来过滤列表显示的项目——全部、已发布、草稿、回收站。默认视图中，显示所有文章。</li><li>您可以使用简单标题列表来查看文章，或是在显示选项面板种加入摘要。</li><li>通过在文章列表上方的下拉菜单中选择，您可单独查看显示某一分类中的文章，或是某月发布的文章。点击列表中作者、分类，或标签也可令列表只显示那些内容。</li></ul>       </div>                 <div id=""tab-panel-action-links"" class=""help-tab-content"">          <p>将鼠标光标悬停在文章列表中的某一行，操作链接将会显示出来，您可以通过它们快速管理文章。您可进行下列操作：</p><ul><li>点击<strong>编辑</strong>可在编辑器中编辑该文章。直接点击文章标题也可以达到同样的效果。</li><li>点击<strong>快速编辑</strong>，您无须跳转到其它页面，在本页内就能对文章属性进行更改。</li><li>点击<strong>移至回收站</strong>，该文章将会从列表中删除，并自动移至回收站。在回收站中，您可永久删除它。</li><li>点击<strong>预览/查看</strong>，您的浏览器将跳转到前台，为您展示文章发布后的效果，或访问已经发布的这篇文章。</li></ul>       </div>                 <div id=""tab-panel-bulk-actions"" class=""help-tab-content"">          <p>您也可以一次删除/回收多个文件。使用文章左侧的复选框，选择您需要操作的文件，然后从“批量操作”下拉菜单中选择您的操作类型。点击“应用”，操作即生效。</p><p>在使用“批量编辑”时，您可以一次编辑这些文章的多个属性（分类目录、作者等）。要从待编辑文章中移除某篇，请在“批量编辑”区域中点击其标题旁边的“x”。</p>       </div>             </div>      </div>     </div>    <div id=""screen-options-wrap"" class=""hidden"" tabindex=""-1"" aria-label=""“显示选项”选项卡""> <form id='adv-settings' method='post'>   <fieldset class=""metabox-prefs"">    <legend>栏目</legend>    <label><input class=""hide-column-tog"" name=""author-hide"" type=""checkbox"" id=""author-hide"" value=""author"" checked='checked' />作者</lab